import React from 'react';

function Resources() {
    return (
        <>
            <main>
                <div className="container">
                    <section className="row">
                        <div className="col-xs-12 col-md-12 mt-5">
                            <h1>Resources</h1>
                        </div>
                    </section>
                </div>
            </main>
        </>
    );
}

export default Resources;
